import React, { useEffect, useState } from 'react';
import Navigation from '../components/Navigation';
import axios from "axios";

const Edit = () => {
    const [data, setData] = useState([]);

    useEffect(() => {
        axios
        .get("https://restcountries.com/v3.1/all")
        .then((res) => setData(res.data));
    }, [])

    return (
        <div>
            <Navigation/>
            <h1>Mode Edition</h1>
            <select>
                {<option></option>}
            </select>
        </div>
    );
};

export default Edit;
